import React, { useState } from 'react';
import { useHistory } from 'react-router-dom'; // if you're using react-router-dom

const AddTemplatePage = () => {
  const [templateName, setTemplateName] = useState('');
  const history = useHistory(); // if you're using react-router-dom

  const handleAddExercises = () => {
    // Redirect to exercises page and pass state
    history.push('/exercises', { isSelectingForTemplate: true, templateName });
  };

  return (
    <div>
      <input
        type='text'
        value={templateName}
        onChange={e => setTemplateName(e.target.value)}
        placeholder='Enter template name'
      />
      <button onClick={handleAddExercises}>Add Exercises</button>
    </div>
  );
};

export default AddTemplatePage;
